css:
.editor .gutter .line-number.git-line-modified {
  border-left: 2px solid #b58900;
  padding-left: calc(0.5em - 2px);
}
.editor .gutter .line-number.git-line-added {
  border-left: 2px solid #859900;
  padding-left: calc(0.5em - 2px);
}
.editor .gutter .line-number.git-line-removed {
  border-left: 2px solid #dc322f;
  padding-left: calc(0.5em - 2px);
}
.editor .gutter.git-diff-icon .line-number {
  width: 100%;
  border-left: none;
  padding-left: 0.4em;
}
.editor .gutter.git-diff-icon .line-number:before {
  font-family: 'Octicons Regular';
  src: url("octicons.woff") format("woff");
  font-weight: normal;
  font-style: normal;
  display: inline-block;
  position: relative;
  top: -0.05em;
  height: 0px;
  width: 1em;
  content: " ";
  padding-right: 0.4em;
  font-size: .95em;
}
.editor .gutter.git-diff-icon .line-number.git-line-modified:before {
  content: "\f052";
  color: #b58900;
}
.editor .gutter.git-diff-icon .line-number.git-line-added:before {
  content: "\f05d";
  color: #859900;
}
.editor .gutter.git-diff-icon .line-number.git-line-removed:before {
  content: "\f0ca";
  color: #dc322f;
}
